import React from 'react';
import HeroSection from '../components/HeroSectionTentang';
import TentangText from '../components/TextTentang';
import './tentang.css';

const Tentang = () => {
  return (
    <div>
        <HeroSection />
        <TentangText />
    </div>
  );
};

export default Tentang;
